def determine_rhyme_scheme(n, k, poem):

    def z(a, b):
        c = 0
        d = ''
        for i in range(len(a) - 1, -1, -1):
            d += a[i]
            if a[i] in ['a', 'e', 'i', 'o', 'u']:
                c += 1
            if c == k:
                break
        f = c == k
        c = 0
        e = ''
        for i in range(len(b) - 1, -1, -1):
            e += b[i]
            if b[i] in ['a', 'e', 'i', 'o', 'u']:
                c += 1
            if c == k:
                break
        return d == e and c == k and f
    a = 1
    b = 0
    c = 0
    d = 0
    for i in range(n):
        e = poem[4 * i]
        f = poem[4 * i + 1]
        g = poem[4 * i + 2]
        h = poem[4 * i + 3]
        a1 = z(e, f)
        a2 = z(e, g)
        a3 = z(e, h)
        a4 = z(f, g)
        a5 = z(f, h)
        a6 = z(g, h)
        if a1 and a2 and a3 and a4 and a5 and a6:
            d += 1
        elif a1 and a6:
            a += 1
        elif a2 and a5:
            b += 1
        elif a3 and a4:
            c += 1
    if a + b + c + d != n:
        return 'NO'
    elif b == 0 and c == 0:
        return 'aaaa' if a == 0 else 'aabb'
    elif a == 0 and c == 0:
        return 'aaaa' if b == 0 else 'abab'
    elif a == 0 and b == 0:
        return 'aaaa' if c == 0 else 'abba'
    else:
        return 'NO'

